import React from 'react';
import { Container } from 'react-bootstrap';

const Contact = () => {
  return (
    <section id="contact" className="py-5">
      <Container>
        <h2 className="text-center mb-4">Contact Us</h2>
        {/* Contact form or information */}
      </Container>
    </section>
  );
};

export default Contact;
